var express = require('express');
var app = express();

// Could be done without Express, but it's a bit more realistic this way...
app.get('/show', function (req, res) {
  res.send('<html><head><title>Cat!</title></head><body><img src=" data:image/jpeg;base64," alt="grumpy_cat" /></body></html>');
});

app.listen(3000, function () {
  console.log('Cat service listening on port 3000');
});
